    public static ArrayList<Card> getCardLibrary(){
        JSONArray lib = JSONArray.parseArray(libJsonStr);
        ArrayList<Card> cardLib = new ArrayList<>();
        for(int i=0 ;i < lib.size();i++){
            Card temp = new Card();
            temp.setId(lib.getJSONObject(i).getInteger("id"));
            Edge top = new Edge(1,
                    lib.getJSONObject(i).getJSONObject("top").getString("type"),
                    lib.getJSONObject(i).getJSONObject("top").getString("connect"));

            Edge bot = new Edge(1,
                    lib.getJSONObject(i).getJSONObject("bot").getString("type"),
                    lib.getJSONObject(i).getJSONObject("bot").getString("connect"));

            Edge lef = new Edge(1,
                    lib.getJSONObject(i).getJSONObject("lef").getString("type"),
                    lib.getJSONObject(i).getJSONObject("lef").getString("connect"));

            Edge rig = new Edge(1,
                    lib.getJSONObject(i).getJSONObject("rig").getString("type"),
                    lib.getJSONObject(i).getJSONObject("rig").getString("connect"));
            temp.setTop(top);
            temp.setBot(bot);
            temp.setLef(lef);
            temp.setRig(rig);
            cardLib.add(temp);
        }
        Collections.shuffle(cardLib);
        return cardLib;
    }
